import logo from "./logo.svg";
import "../App.css";

function App() {
  return (
    <header className="App-header">
      <img src={logo} className="React-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </header>
  );
}

export default App;
